import { Switch, Route } from "react-router-dom";
import Header from "../../component/Header";
import Footer from "../../component/Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <Switch>
        <Route path="/" component={Home} exact />
      </Switch>
      <Footer />
    </div>
  );
}

export default App;
